        if strict_match and len(request_headers) != len(headers):
            return False

        for k, v in headers.items(): #  [STATE] k = 'Accept' [/STATE] [STATE] v = 'application/json' [/STATE]
            if request_headers.get(k) is not None:
                if isinstance(v, re.Pattern):
                    if re.match(v, request_headers[k]) is None:
                        return False
                else:
                    if not v == request_headers[k]:
                        return False
            elif strict_match:
                return False

        return True

